// src/index.tsx

import React from 'react';
import ReactDOM from 'react-dom/client';
import './index.css';  // Opcional, pode ser o estilo que você desejar
import App from './app'; 


const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>
);
